DROP TABLE CAD PURGE;

CREATE TABLE CAD (
  GID         integer NOT NULL,
  CD_POLY_PID  varchar2(15),
  STREET_NAME varchar2(100),
  GEOM        sdo_geometry,
 CONSTRAINT CAD_PK PRIMARY KEY (GID)
);


